import React from 'react';
import myphoto from '../public/logo2.png'

const Home = () =>{
  return(
    <div class="row">
      <div class="col-sm-8" ></div>
      <div class="col-sm-4" >
      <div class="jumbotron my-5 mr-5">
        <div class="jumbotron my-5 mr-5 ml-5">
          <img src={myphoto} height="150px" width="150px"/>
        </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
